// to use a complex file name to prevent same name with user project
// e.g. bad name init-dayjs.js
// e.g. good name init-dayjs-webpack-plugin-entry
var dayjs = require("dayjs/dayjs.min");
var isSameOrBefore = require("dayjs/plugin/isSameOrBefore");
var isSameOrAfter = require("dayjs/plugin/isSameOrAfter");
var advancedFormat = require("dayjs/plugin/advancedFormat");
var customParseFormat = require("dayjs/plugin/customParseFormat");
var weekday = require("dayjs/plugin/weekday");
var weekYear = require("dayjs/plugin/weekYear");
var weekOfYear = require("dayjs/plugin/weekOfYear");
var isMoment = require("dayjs/plugin/isMoment");
var localeData = require("dayjs/plugin/localeData");
var localizedFormat = require("dayjs/plugin/localizedFormat");
dayjs.extend(isSameOrBefore);
dayjs.extend(isSameOrAfter);
dayjs.extend(advancedFormat);
dayjs.extend(customParseFormat);
dayjs.extend(weekday);
dayjs.extend(weekYear);
dayjs.extend(weekOfYear);
dayjs.extend(isMoment);
dayjs.extend(localeData);
dayjs.extend(localizedFormat);
var antdPlugin = require("antd-dayjs-webpack-plugin/src/antd-plugin");
dayjs.extend(antdPlugin);
